import "./App.scss";
import React from "react";
function App() {
  return React.createElement(
    "div",
    { className: "App" },
    React.createElement(
      "header",
      { className: "App-header" },
      React.createElement(
        "p",
        null,
        "Edit ",
        React.createElement("code", null, "src/App.js"),
        " and save to reload.",
      ),
      React.createElement(
        "a",
        {
          className: "App-link",
          href: "https://reactjs.org",
          target: "_blank",
          rel: "noopener noreferrer",
        },
        "Learn React",
      ),
    ),
  );
}
export default App;
